import React, { Component } from 'react';

class Serachbar extends Component {
  
  formSubmit=(event)=>{
      event.preventDefault();
      
  }
  
  render() {
    return <form onSubmit={this.formSubmit}>
      <div className='form-row mb-5'>
        <div className='col-8'>
          <input onChange={this.props.searchMovieProp} 
          type="text" className='form-control' placeholder='Search movie'></input>

        <div  className='col-10'>
        </div>
        <button type='button' className='btn btn-md btn-primary col-4'>Ekle</button>

        </div>
      </div>
    </form>
  }
}
export default Serachbar;
